          this.flagbtn2="text";
          this.flagbtn3="text";
          this.flagbtn4="text";
        }
        if(n=="2"){
          this.nn="2"
        this.flagbtn1="text";
        this.flagbtn2="outlined";
        this.flagbtn3="text";
        this.flagbtn4="text";
      }
       
      this.disabledValue=false;
      }
    }
  }
</script>
